                                print(f"Fold: {fold_num}, RMSE: {rmse}, RRMSE: {rrmse_test}, MAPE: {mape_test}")

                                rmse_values.append(rmse)
                                mape_values.append(mape_test)
                                rrmse_values.append(rrmse_test)

